const SET_STATE = {
        videos:[],
        loading: false,
        error: false
}

export default function search (state = SET_STATE, ACTION){
    switch(ACTION.type){
        case 'SEARCH_VIDEO':
            return{
                videos:[],
                loading: false,
                error: false

            }

        case 'SEARCH_VIDEO_SUCESS':
            return{
                videos: ACTION.videos,
                loading: false,
                error: false
            }

        case 'SEARCH_VIDEO_ERROR':
            return{
                videos: [],
                loading: false,
                error: true

            }
    
    default: return state
        }

}
